import React from "react";
import ReactDOM from "react-dom";
import Link from "next/link";
import { Menu, Input, Row, Col } from "antd";

const AppLayout = ({ children }) => {
    return (
        <>
            <Menu mode="horizontal">
                <Menu.Item key="home">
                    <Link href="/">
                        <a>Home</a>
                    </Link>
                </Menu.Item>
                <Menu.Item key="profile">
                    <Link href="/profile">
                        <a>Profile</a>
                    </Link>
                </Menu.Item>
                <Menu.Item key="signup">
                    <Link href="/signup">
                        <a>Signup</a>
                    </Link>
                </Menu.Item>
                <Input.Search placeholder="input search text" onSearch={(value) => console.log(value)} style={{ width: 200, verticalAlign: "middle" }} />
            </Menu>
            <Row>
                <Col xs={24} md={6}>
                    왼쪽 메뉴
                </Col>
                <Col xs={24} md={12}>
                    {children}
                </Col>
                <Col xs={24} md={6}>
                    왼쪽 메뉴
                </Col>
            </Row>
        </>
    );
};

export default AppLayout;
